// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

contract TimeLockSavings is ReentrancyGuard, Ownable {
    struct Deposit {
        address user; // Address of the user who made the deposit
        uint256 amount; // Amount deposited
        string reason; // Reason for the deposit
        uint256 maturityDate; // Maturity date of the deposit
        bool withdrawn; // Whether the deposit has been withdrawn
    }

    // Track all deposits for each user
    mapping(address => Deposit[]) public userDeposits;

    // Track total savings balance for each user
    mapping(address => uint256) public savingsBalance;

    // Track total penalties collected
    uint256 public totalPenalties;

    // Early withdrawal penalty rate (10%)
    uint256 public earlyWithdrawalPenalty = 10;

    // Addresses for penalties and savings wallets
    address public immutable penaltiesWallet;
    address public immutable savingsWallet;

    // Events
    event DepositMade(
        address indexed user,
        uint256 amount,
        string reason,
        uint256 maturityDate,
        uint256 depositIndex
    );
    event WithdrawalMade(
        address indexed user,
        uint256 amount,
        bool early,
        uint256 penalty
    );
    event PenaltyRateUpdated(uint256 oldRate, uint256 newRate);

    constructor(address _penaltiesWallet, address _savingsWallet) Ownable(msg.sender) {
        require(_penaltiesWallet != address(0), "Invalid penalties wallet");
        require(_savingsWallet != address(0), "Invalid savings wallet");
        penaltiesWallet = _penaltiesWallet;
        savingsWallet = _savingsWallet;
    }

    function deposit(
        string memory _reason,
        uint256 _maturityDate
    ) external payable nonReentrant {
        require(msg.value > 0, "Deposit amount must be greater than 0");
        require(_maturityDate > block.timestamp, "Maturity date must be in the future");
        require(bytes(_reason).length > 0, "Reason cannot be empty");

        // Add the deposit to the user's deposit array
        userDeposits[msg.sender].push(Deposit({
            user: msg.sender,
            amount: msg.value,
            reason: _reason,
            maturityDate: _maturityDate,
            withdrawn: false
        }));

        // Update the user's total savings balance
        savingsBalance[msg.sender] += msg.value;

        // Transfer the deposited funds to the savings wallet
        (bool success, ) = payable(savingsWallet).call{value: msg.value}("");
        require(success, "Transfer to savings wallet failed");

        // Emit an event
        emit DepositMade(
            msg.sender,
            msg.value,
            _reason,
            _maturityDate,
            userDeposits[msg.sender].length - 1 // Deposit index
        );
    }

    function withdraw(uint256 _depositIndex) external nonReentrant {
        require(_depositIndex < userDeposits[msg.sender].length, "Invalid deposit index");
        Deposit storage userDeposit = userDeposits[msg.sender][_depositIndex];

        require(!userDeposit.withdrawn, "Already withdrawn");
        require(userDeposit.amount > 0, "No deposit found");

        uint256 amount = userDeposit.amount;
        uint256 penalty = 0;
        bool early = block.timestamp < userDeposit.maturityDate;

        if (early) {
            penalty = (amount * earlyWithdrawalPenalty) / 100;
            amount -= penalty;

            // Transfer penalty to penalties wallet
            (bool penaltySuccess, ) = payable(penaltiesWallet).call{value: penalty}("");
            require(penaltySuccess, "Penalty transfer failed");

            // Track total penalties collected
            totalPenalties += penalty;
        }

        userDeposit.withdrawn = true;

        // Update the user's total savings balance
        savingsBalance[msg.sender] -= userDeposit.amount;

        // Transfer remaining amount to user
        (bool success, ) = payable(msg.sender).call{value: amount}("");
        require(success, "Transfer failed");

        emit WithdrawalMade(msg.sender, amount, early, penalty);
    }

    // Get all deposits for a specific user
    function getUserDeposits(address _user) external view returns (Deposit[] memory) {
        return userDeposits[_user];
    }

    // Get the total savings balance for a specific user
    function getSavingsBalance(address _user) external view returns (uint256) {
        return savingsBalance[_user];
    }

    // Get the total penalties collected
    function getTotalPenalties() external view returns (uint256) {
        return totalPenalties;
    }

    // Update the penalty rate (only owner)
    function setPenaltyRate(uint256 _newPenalty) external onlyOwner {
        require(_newPenalty <= 20, "Penalty too high");
        uint256 oldRate = earlyWithdrawalPenalty;
        earlyWithdrawalPenalty = _newPenalty;
        emit PenaltyRateUpdated(oldRate, _newPenalty);
    }
}

